script: |
  super -f text -I q8486.spq | sort > q8486.out

inputs:
  - name: q8486.spq
    data: |
      SELECT DISTINCT 63 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 - 21 * col0 + - col1 * + col0 BETWEEN + col2 AND ( - + col2 / - col0 * 31 - + col2 + ( 59 + ( 13 - - col2 ) * + 67 ) * col1 * + col2 );
  - name: tab1

outputs:
  - name: q8486.out
    data: |
